// src/App.js
import React from "react";
import { BrowserRouter, Routes, Route, useNavigate } from "react-router-dom";
import Login from "./Login";
import Register from "./Register";
import "./styles.css";
import api from "./api";

function Dashboard({ title }) {
  const nav = useNavigate();
  const logout = () => {
    localStorage.removeItem("access_token");
    localStorage.removeItem("refresh_token");
    nav("/");
  };

  // get username from localStorage/profile? For simplicity we show title only.
  return (
    <>
      <div className="topbar">
        <div className="brand">Maritime Tracking Platform</div>
        <div style={{ display: "flex", gap: 12, alignItems: "center" }}>
          <div className="meta">Signed in</div>
          <button className="btn btn-ghost" onClick={() => { /* optional profile */ }}>Profile</button>
          <button className="btn logout-btn" onClick={logout}>Logout</button>
        </div>
      </div>

      <div className="container">
        <div className="card">
          <h2>{title}</h2>
          <p>Welcome to the {title}. Protected content goes here.</p>
        </div>
      </div>
    </>
  );
}

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/operator" element={<Dashboard title="Operator Dashboard" />} />
        <Route path="/analyst" element={<Dashboard title="Analyst Dashboard" />} />
        <Route path="/admin" element={<Dashboard title="Admin Dashboard" />} />
      </Routes>
    </BrowserRouter>
  );
}
